package com.hy.cb.controller.api;

import java.util.HashMap;
import java.util.Map;

import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;

import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.ResponseBody;

import com.hy.cb.utils.api.Uploader;
import com.hy.cb.utils.api.WebServiceResult;
import com.hy.sys.utils.StringTools;
import com.hy.sys.utils.StringUtils;


@Controller
@RequestMapping(value = "/api/upload")
public class UploadAttachmentApiController {

	/**
	 * 附件上传
	 * 
	 * @param req
	 * @param response
	 * @return
	 */
	@ResponseBody
	@RequestMapping(value = "uploadAttachment")
	public WebServiceResult uploadingAttachment(
			HttpServletRequest req, HttpServletResponse response) {
		WebServiceResult json = new WebServiceResult();
		try {
			Map<String,Object> map = new HashMap<String, Object>();
			Uploader upload = new Uploader(req);
			String Base64FileCode = req.getParameter("Base64FileCode");
	        //Base64FileCode="";
			String subPath = req.getParameter("subPath");
			upload.setFileName(StringUtils.getYMDhmsRand()+".png");
			if (StringTools.isNotEmpty(Base64FileCode)) {
				upload.uploadFileBase64(req,Base64FileCode, subPath);
				map.put("subPath", upload.getUrl());//  
			}
			json.setCode(1);
			json.setMessage("上传成功！");
			json.setSuccess(true);
			json.setDatas(map);
		} catch (Exception e) {
			json.setCode(0);
			json.setMessage("上传失败！");
			json.setSuccess(false);
		}
		return json;
	}
}
